Storyline

Set in the most depressing corner of a postapocalyptic future, our heroine Kantmiss Evershot (Maiara Walsh) volunteers to take her manipulative younger sister's place in the seventy-fifth annual &quot;Starving Games.&quot; In doing so, she must leave behind her smoldering just-a-friend Dale (Brant Daugherty) and team up with the geeky baker's son Peter Malarkey (Cody Allen Christian) in a fight for her life. But wait, there's more! She could also win an old ham, a coupon for a foot-long sub at a six-inch price, and a partially eaten pickle! In The Starving Games, Friedberg and Seltzer's sixth cinematic spoof of box-office hits, the prolific parody duo has its sights trained on the adventure blockbuster The Hunger Games! It's all the laughs and half the calories as they sling dozens of cock-eyed, barbed arrows at sci-fi, action and fantasy films from The Avengers and Oz the Great and Powerful to pop culture characters and celebrities like Harry Potter and Taylor Swift.


